object Solution {
    def minOperations(nums: Array[Int], k: Int): Int = {
        var xorSum = nums.reduce(_ ^ _)
        if (xorSum == k) return 0
        val bitFrequency = new Array[Int](32)
        for (num <- nums) {
            for (i <- 0 until 32) {
                if ((num & (1 << i)) != 0) {
                    bitFrequency(i) += 1
                }
            }
        }
        var operations = 0
        for (i <- 31 to 0 by -1) {
            if ((xorSum & (1 << i)) != (k & (1 << i))) {
                if (bitFrequency(i) > 0) {
                    operations += 1
                    xorSum ^= (1 << i)
                } else {
                    return -1
                }
            }
        }
        operations
    }
}
